  console.log(state)

  useEffect(()=>{

    useEffect(()=>{
      fatchData()
    })
  },[])

  const fatchData= async()=>{

    const resp= await fatchData()
    const data= await resp.json()
    
    //console.log(data)
    setState(data)
  }


  return (
    <div>
       <div>
        <h1>NIkhil Store</h1>
    <div>
 {

    state.map((e)=>{
      return(
        <div>
          <img src={e.image} height="200px"/>
          <h1>{e.id}. {e.title}</h1>
          <h3>Price: {e.price}</h3>
        </div>
      )
    })

  }
    </div>
       </div>

    </div>
  )
}
